import { combineReducers } from 'redux'
import auth from './auth'
import { FETCH_CATEGORIES } from '../actions'


export default combineReducers({
  categories: categories
})

function categories(state=[], action) {
  switch (action.type) {
    case FETCH_CATEGORIES: 
    return []
  }
}
